sources.styles/blocks/_header.scss:
.header {
  background-size: cover;
  background-position: center;
  background-image: url(../images/header.png);

  &__title {
    font-family: 'Roboto';
    font-style: normal;
    font-weight: 700;
    font-size: 46px;
    line-height: 40px;
    color: #fff;
    letter-spacing: -1px;

    @include onDesktop {
      font-size: 80px;
      line-height: 80px;
      letter-spacing: -1.5px;
    }

    &::before {
      content: "";
      display: block;
      width: 40px;
      height: 2px;
      background: #FFFFFF;
      border-radius: 8px;

      margin-bottom: 24px;
    }
  }

  &__content {
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    height: 100vh;
    padding: 24px 0 80px;
    box-sizing: border-box;
  }

  &__nav {
    display: flex;
    justify-content: space-between;
    align-items: center;
  }

  &__menu-opener {
    background-image: url(../images/menu.svg);

    &:hover {
      background-image: url(../images/menu_hover.svg);
      background-size: cover;
      background-position: center;
      background-repeat: no-repeat;
    }
  }

  &__call {
    text-decoration: none;
    background-image: url(../images/phone.svg);

    @include onDesktop {
      &::before {
      content: "+1 234 555-55-55";
      position: relative;
      top: 50%;
      transform: translate(-100%, -50%);

      display: block;
      padding-right: 20px;
      width: max-content;

      font-weight: 700;
      font-size: 12px;
      line-height: 16px;
      color: #fff;
      letter-spacing: 2px;
      text-transform: uppercase;
      opacity: 0;
      pointer-events: none;
    }

      &:hover::before {
      opacity: 1;
      pointer-events: none;
      }
    }
  }
}

