sources.styles/blocks/_form.scss:
.form-field {
    box-sizing: border-box;
    display: block;
    background-color: #F7F8FF;
    border: 1px solid transparent;
    border-radius: 8px;
    height: 48px;
    width: 100%;
    color: #000;
    padding: 14px 16px;
    font-family: 'Roboto';

    @include onDesktop {
        width: 411px;
    }

    &::placeholder {
        font-size: 14px;
        line-height: 20px;

        color: #8F99A8;
    }

    &-text {
        height: 144px;
        resize: none;
        font-family: 'Roboto';
        font-style: normal;
    }

    &-contact {
        margin: 0 0 16px;
    }

    &:hover {
        background: #F7F8FF;
        border: 2px solid #CCD0E0;
        border-radius: 8px;
    }

    &:focus {
        background: #F7F8FF;
        border: 2px solid #0075FF;
        border-radius: 8px;
        outline: none;
    }
}
